import './App.css'
import espeto from './Fotos/espetinho.png'


function App() {
  return (
    <div className="app_conteiner" >
      <img src={espeto} />
      <div>
        <button>Cadastre-se</button>
        <butoon>logar na conta</butoon>
      </div>

    </div>
  );
}

export default App;
